## 代码

```C++
class Solution {
public:
    vector<int> maxSlidingWindow(vector<int>& nums, int k) {
        vector<int> res;
        if (nums.size() <= 0 || k <= 0) return res;
        int n = nums.size();
        int left = 0, right = 0;
        while (right < n) {
            res.push_back(nums[right]);
            if (right - left + 1 == k) {
                res.push_back(nums[left]);
                left++;
            }
            right++;
        }
        return res;
    }
};
```

