func rotate(nums []int, k int) {
	n := len(nums)
	if n == 0 {
		return
	}
	if k > n {
		k = k % n
	}
	for i := 0; i < k; i++ {
		nums[i], nums[n-1] = nums[n-1], nums[i]
	}
}

